import * as React from "react";
import NavRoute from "./Routes/Routes";
import Header from "./Header/Header"
import Footer from "./Header/Footer"
import Content from "./Content/Content"

function App() {
  return (
    <div className="App">
      <h1>Welcome to React Router!</h1>
      <Header />
      <NavRoute />
      <Content />
      <Footer />
    </div>
  );
}

  export default App;
